import React, {useState,useEffect} from "react";
import NavBar from "../common/navBar";
import axios from 'axios'
import Table from 'react-bootstrap/Table'


const MarkingScheme = (props) => (
  <tr>
    <td>{props.markingScheme.citerion}</td>
    <td>{props.markingScheme.vgood}</td>
    <td>{props.markingScheme.avg}</td>
    <td>{props.markingScheme.poor}</td>
    <td>{props.markingScheme.mark}</td>
  </tr>
);

export default function ViewMarkingSchemes(){

  const [markingSchemes,setMarkingSchemes]=useState([]);

  useEffect(()=>{

     function getMarkingScheme() {
      axios.get('http://localhost:5000/markingScheme/').then((response) => {

      // if (!response.ok) {
      //   const message = `An error occurred: ${response.statusText}`;
      //   window.alert(message);
      //   return;
      // }

      const markingSchemes =  response.d;
      setMarkingSchemes(markingSchemes);


      
    })
   
  

  }[]

  getMarkingScheme();
});


  function marking(){

    return markingSchemes.map((marking)=>{

      return (
        <MarkingScheme
         marking={marking}
         />
      )

    })
  }



    return(

        <div>
            <NavBar/>
<div className="container">
            <Table>
            <tbody>
              <tr>
              <th>Criterion</th>
              <th>Very good</th>
              <th>Average</th>
              <th>Poor</th>
              <th>Mark</th>
              </tr>
                <tr>
                {marking()}
                </tr>
              </tbody>
            </Table>
           
            <Table striped bordered hover variant="dark">
  <thead>
    <tr>
      
      <th>Criterion</th>
      <th>Comment</th>
      <th>Mark</th>
    </tr>
  </thead>
  <tbody>
    <tr>
       <td>Understanding</td>
      <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Scientific
Practice</td>
       <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Effort</td>
       <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Initiative and
self-motivation </td>
       <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Achievement </td>
      <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Report Content </td>
      <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td>Report
Presentation </td>
      <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
    <tr>
       <td> Oral Exam</td>
      <td><input type='text'/></td>
      <td><input type='text'/></td>
    </tr>
  
  </tbody>
</Table>

</div>
        </div>


    )
}
